import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));

let messagesData = [
  { id: 1, message: "Hello" },
  { id: 2, message: "Hi" },
  { id: 3, message: "Fuck you" },
  { id: 4, message: "Bitch" },
];
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

